<?php


class Icon
{
     private $iconHtml;
     public $iconName;
     public $iconClass = 'icon';
     function __construct($iconname, $iconhtml)
     {
          $this->iconName = $iconname;
          $this->iconHtml = $iconhtml;
          // createFile('/icons/' . $iconname . '.svg', $iconhtml, [
          //      'title' => str_replace('Icon', '', $iconname) . '.svg'
          // ]);
          add_shortcode($iconname, [$this, 'iconinit']);
     }

     function iconinit($atts = [])
     {

          $atts = array_change_key_case((array)$atts, CASE_LOWER);
          $buttonAtts = shortcode_atts([
               'class' => '',
               'id' => '',
               'size' => 'sm',

          ], $atts);


          ob_start();
?>
          <i id='<?php echo $buttonAtts['id'] ?>' class="<?php echo $buttonAtts['class']  . " " . $this->iconClass . " icon-" . $buttonAtts['size']  ?> "><?php echo $this->iconHtml ?></i>

     <?php
          return ob_get_clean();
     }
}


function url_to_icon(string $url, $color = '')
{
     $root = parse_url($url, PHP_URL_HOST);
     $allowedIcons = ['twitter', 'facebook', 'google', 'youtube'];
     $root =
          $root =  str_ireplace('www.', '', $root);
     $root =   str_ireplace('.com', '', $root);
     if (!in_array($root, $allowedIcons))
          return null;

     if (!$color) {
          switch ($root) {
               case "google":
               case "twitter":
                    $color = "blue";
                    break;
               case "youtube":
                    $color = 'red';
                    break;
               case "facebook":
                    $color = 'blue';
                    break;
          }
     }
     ?>
     <i class="bi  bi-<?= $root . ' ' . $color ?>"></i>

<?php
}

